window.bookSummaryJSON = "<p><b><i>The Final Installment of the American Vampires Trilogy</i></b><br> <br> <b><i>Ryet</i></b><br> The hunger burns, the feeding soothes. I hate this curse, I hate the world, and most of all, I hate myself. Because I am chained to the blood of the only thing I truly want—the little Black witch called Syrsee.<br> <br> <b><i>Syrsee</i></b><br> I thought it would be simple: feed the scion, survive his transformation, forge some kind of new life together. But each drop I give Ryet brings the Darkness closer. Each drop he takes drags the demon out.<br> <br> <b><i>Paul</i></b><br> For thousands of years, the Darkness ignored me. But that monster was never my god, and Josep was never my salvation. It is Ryet who will deliver me from evil.<br> <br> <b><i>Josep</i></b><br> I alone hold the power to create a vampire. Not Paul. There is but one, and it is me. I am the monster. I am the king—unrivaled and invincible.<br> <br> <b><i>Little Baby</i></b><br> I was a mistake. From the moment I was born, I was unwanted. Discarded. And then he found me. Evil itself wanted me. But if I am damned to eternal Hell, I’m taking someone down with me.<br> <br> <b><i>Blood Brothers is giving</i></b><b>…</b><br> Dark Poly<br> Morally Black<br> Forced Proximity<br> Vampires Do Not Sparkle<br> Uncontrollable Cravings<br> Enemies to Lovers<br> Power Imbalance<br> Road To Hell<br> Anti-Hero</p>"; 
